    <div className='container-fluid'>
      <div className="row">
        <div className="col-md-6 mt-2 offset-md-3 p-4 border rounded shadow ">
          <div className="text-center m-4">Register User</div>
          <div className="row justify-content-center">
          <div className="row">
          <div htmlFor='Name' className='col-form-label col-md text-start'>Name</div>
          <input type={"text"} className='col-form-control col-md-5' placeholder='Enter your Name' ></input>
          </div>
        </div>


      </div>
      </div>
      
    </div>
    
  )
}
